import { Button, Input, Grid, createStyles  } from '@mantine/core';
import { DatePicker } from '@mantine/dates';
import {
  RegisterSection
} from "./styles";

const useStyles = createStyles((theme) => ({
  track: {
    backgroundColor: theme.colorScheme === 'dark' ? theme.colors.dark[3] : theme.colors.blue[1],
  },
  mark: {
    width: 6,
    height: 6,
    borderRadius: 6,
    transform: 'translateX(-3px) translateY(-2px)',
    borderColor: "62D2A2"
  },
  markFilled: {
    borderColor: theme.colors.blue[6],
  },
  markLabel: { fontSize: theme.fontSizes.xs, marginBottom: 5, marginTop: 0 },
  thumb: {
    height: 16,
    width: 16,
    backgroundColor: theme.white,
    borderWidth: 1,
    boxShadow: theme.shadows.sm,
  },
}));

export function Register() {
  const { classes } = useStyles();
  return (
    <RegisterSection>
      <Grid>
        <Grid.Col>
          <Input.Wrapper
            id="input-nome"
            withAsterisk
            label="Nome Completo"

          >
            <Input id="input-nome" placeholder="Nome Completo" className='mark: classes.mark'/>
          </Input.Wrapper>
        </Grid.Col>
        <Grid.Col span={6}>
          <DatePicker
            placeholder="Selecione sua data de nascimento"
            label="Data de Nascimento"
            inputFormat="DD/MM/YYYY"
            labelFormat="MM/YYYY"
            withAsterisk
            defaultValue={new Date()}
          />
        </Grid.Col>
        <Grid.Col span={6}>
          <Input.Wrapper
            id="input-nome"
            withAsterisk
            label="Nome Completo"
          >
            <Input id="input-nome" placeholder="Nome Completo" />
          </Input.Wrapper>
        </Grid.Col>
        <Grid.Col>
          <Button className="bg-primary-accent hover:bg-secondary-accent">
            Cadastrar
          </Button>
        </Grid.Col>
      </Grid>
    </RegisterSection>

  );
}
